package ra.Model.Entity;public class Contact {    private int contactID;    private int phoneNumber;    private String email;    private String website;    private String address;    public Contact(int contactID, int phoneNumber, String email, String website, String address) {        this.contactID = contactID;        this.phoneNumber = phoneNumber;        this.email = email;        this.website = website;        this.address = address;    }    public Contact() {    }    public int getContactID() {        return contactID;    }    public void setContactID(int contactID) {        this.contactID = contactID;    }    public int getPhoneNumber() {        return phoneNumber;    }    public void setPhoneNumber(int phoneNumber) {        this.phoneNumber = phoneNumber;    }    public String getEmail() {        return email;    }    public void setEmail(String email) {        this.email = email;    }    public String getWebsite() {        return website;    }    public void setWebsite(String website) {        this.website = website;    }    public String getAddress() {        return address;    }    public void setAddress(String address) {        this.address = address;    }}